function langBuildings(key) {
    if (buildingsCZ.hasOwnProperty(key['id']) && localStorage.getItem("lang") !== 'en') {
        switch (localStorage.getItem("lang")) {
            case 'cz': {
                if (buildingsCZ.hasOwnProperty(key['id'])) {
                    return buildingsCZ[key['id']];
                } else {
                    return key['name'];
                }
            }
            case 'de': {
                if (buildingsDE.hasOwnProperty(key['id'])) {
                    return buildingsDE[key['id']];
                } else {
                    return key['name'];
                }
            }
            case 'fr': {
                if (buildingsFR.hasOwnProperty(key['id'])) {
                    return buildingsFR[key['id']];
                } else {
                    return key['name'];
                }
            }
            case 'hu': {
                if (buildingsHU.hasOwnProperty(key['id'])) {
                    return buildingsHU[key['id']];
                } else {
                    return key['name'];
                }
            }
            case 'pl': {
                if (buildingsPL.hasOwnProperty(key['id'])) {
                    return buildingsPL[key['id']];
                } else {
                    return key['name'];
                }
            }
            case 'ru': {
                if (buildingsRU.hasOwnProperty(key['id'])) {
                    return buildingsRU[key['id']];
                } else {
                    return key['name'];
                }
            }
        }
    } else {
        return key['name'];
    }
}